                  var finalElt = elt;
                  if (!bodyContains(elt)) {
                      finalElt = getDocument().body;
                  }
                  handleTrigger(xhr, "HX-Trigger-After-Settle", finalElt);
              }
          };
          if (swapSpec.settleDelay > 0) {
              setTimeout(doSettle, swapSpec.settleDelay);
          } else {
